import React from "react";
import TodayIcon from '@mui/icons-material/Today';

const Header =() =>{
    return(
    <>
       <img src={TodayIcon} alt="logo" width="75" height="55" />
       <h1>My Remainder List</h1>
    </>
    );
};

export default Header;
